import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';


function App() {

  const [inputUsername, setUsername] = useState('');
  const [inputPassword, setPassword] = useState('');

  const submitButtonHandler = (event) => {
    console.log(1);
  }


  const usernameHandler = (event) => {
    setUsername(event.target.value);
  }

  const passwordHandler = (event) => {
    setPassword(event.target.value);
  }


  return (
    <div className="App">
      <form>
        Username: <input type="text" defaultValue="" onChange={usernameHandler}/>
        <br></br>
        Password: <input type="password" defaultValue="" onChange={usHandler} id="psw" name="psw" pattern="(?=.*\d)(?=.*[a-z])(?=.*[A-Z]).{8,}" title="Must contain at least one number and one uppercase and lowercase letter, and at least 8 or more characters" required/>
        <br></br>
        <input type="submit" value="Submit" onClick={submitButtonHandler}></input>
      </form>
    </div>
  );
}

export default App;
